def match_product(request, name):
 # Use the keys of the dictionary for fuzzy matching
    product_names = list(dictionary.keys())

    # Find the best match for the given name
    best_match_name, score = process.extractOne(name, product_names)

    # Retrieve the full dictionary entry using the best match name
    product_info = dictionary.get(best_match_name, {})

    # Return the product info as a JSON response
    return JsonResponse({"query": name, "best_match": best_match_name, "product_info": product_info})

